// SPDX-License-Identifier: MIT
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.7/VRFConsumerBase.sol";
import "../library/Governance.sol";
import "../interface/INftAsset.sol";
import "./BlindBox.sol";

contract BlindBoxFactory is Governance, VRFConsumerBase, IERC721Receiver {
    using Address for address;
    using SafeMath for uint256;

    struct BlindContractData {
        uint256 maxCount;
        address nftContract;
    }
    event BlindBoxAdded(address nft, uint256 indexed id, address author);
    event BlindBoxCreated(
        string name,
        string symbol,
        address nft,
        uint256 maxCount
    );

    mapping(string => BlindContractData) _nameToContractData;
    mapping(address => BlindContractData) _addressToContractData;

    ERC20 _cifiTokenContract = ERC20(0x0);

    address public _feeAccount = address(0x0000000000000000000000);
    uint256 public _feeAmount = 0;

    uint256 _linkFee = 0;
    bytes32 _linkKeyHash = bytes32("");
    mapping(bytes32 => address) public requestIdToMinter;
    mapping(bytes32 => address) public requestIdToContract;

    constructor(
        address cifi,
        address vrfCoordinator,
        address linkToken,
        bytes32 linkKeyHash,
        uint256 linkFee
    ) VRFConsumerBase(vrfCoordinator, linkToken) {
        _cifiTokenContract = ERC20(cifi);
        _feeAccount = msg.sender;
        _feeAmount = 1 * (10**18);
        _linkFee = linkFee;
        _linkKeyHash = linkKeyHash;
    }

    function createBlindBox(
        string memory name,
        string memory symbol,
        string memory baseURI,
        uint256 maxNftCount
    ) public onlyGovernance returns (address) {
        require(
            _nameToContractData[name].nftContract == address(0),
            "The name was already used"
        );
        BlindBox nftContract = new BlindBox(name, symbol, baseURI);
        BlindContractData memory contractData;
        contractData.maxCount = maxNftCount;
        contractData.nftContract = address(nftContract);
        _nameToContractData[name] = contractData;
        _addressToContractData[address(nftContract)] = contractData;
        emit BlindBoxCreated(name, symbol, address(nftContract), maxNftCount);
        return address(nftContract);
    }

    /**
     * @dev set cifi contract address
     */
    function setCifiContract(address cifi) public onlyGovernance {
        _cifiTokenContract = ERC20(cifi);
    }

    function ChangeFeeAccount(address newFeeAccount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAccount = newFeeAccount;
        return true;
    }

    function ChangeFeeAmount(uint256 newFeeAmount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAmount = newFeeAmount;
        return true;
    }

    function mint(address nftContract) public returns (bytes32) {
        BlindContractData memory contractData = _addressToContractData[
            nftContract
        ];
        require(
            contractData.nftContract != address(0) &&
                contractData.nftContract == nftContract,
            "BlindBoxFactory: Invalid Nft address"
        );

        require(
            LINK.balanceOf(address(this)) >= _linkFee,
            "BlindBoxFactory: Not enough LINK - fill contract with faucet"
        );
        require(
            BlindBox(nftContract).totalSupply() < contractData.maxCount,
            "BlindBoxFactory: Total tokens were already minted!"
        );
        _cifiTokenContract.transferFrom(msg.sender, _feeAccount, _feeAmount);
        bytes32 requestId = requestRandomness(_linkKeyHash, _linkFee);
        requestIdToMinter[requestId] = msg.sender;
        requestIdToContract[requestId] = nftContract;
        return requestId;
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness)
        internal
        override
    {
        address nftContract = requestIdToContract[requestId];
        BlindContractData memory contractData = _addressToContractData[
            nftContract
        ];
        require(
            BlindBox(nftContract).totalSupply() < contractData.maxCount,
            "Total tokens were already minted!"
        );
        address minter = requestIdToMinter[requestId];
        uint256 nftID = (randomness % contractData.maxCount) + 1;

        while (BlindBox(nftContract).exists(nftID)) {
            nftID = ((nftID + 1) % contractData.maxCount) + 1;
        }

        BlindBox(nftContract).mint(minter, nftID);
        emit BlindBoxAdded(nftContract, nftID, minter);
    }

    function burn(address nftContract, uint256 tokenId)
        external
        returns (bool)
    {
        BlindContractData memory contractData = _addressToContractData[
            nftContract
        ];
        require(
            contractData.nftContract != address(0) &&
                contractData.nftContract == nftContract,
            "BlindBoxFactory: Invalid Nft address"
        );
        BlindBox(nftContract).safeTransferFrom(
            msg.sender,
            address(this),
            tokenId
        );
        BlindBox(nftContract).burn(tokenId);
        return true;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
